import React from "react";
import { View, Text, TouchableOpacity, Image } from "react-native";
import { styles } from "./styles";

const ImagePerfilLogado = require("../../assets/PerfilLogado.png");
const ImageSetinhaLogado = require("../../assets/SetaLogado.png");
const ImageLupa = require("../../assets/Lupa.png");
const ImageSininho = require("../../assets/Sino.png");
const HeaderPag2 = () => {
  return (
    <View style={styles.header}>
      <Image source={ImagePerfilLogado} style={styles.imagePerfilLogado} />
      <View style={styles.viewHeader}>
        <Text style={styles.text1Header}>Gabriel Cruz</Text>
        <Image source={ImageSetinhaLogado} style={styles.imageSetinhaLogado} />
      </View>
      <View style={styles.iconsContainer}>
        <TouchableOpacity>
          <Image source={ImageLupa} style={styles.imageLupa} />
        </TouchableOpacity>
        <TouchableOpacity>
          <Image source={ImageSininho} style={styles.imageSininho} />
        </TouchableOpacity>
      </View>
    </View>

  );
};

export default HeaderPag2;
